import React from "react";
import styles from "./Header.module.css";

const Header = (props) => {
  return (
    <>
      <header className={styles.header}>
        <nav>
          <h1>Food order app</h1>
          <ul>
            <li>Chart</li>
          </ul>
        </nav>
      </header>
      <div></div>
    </>
  );
};

export default Header;
